void payload_checksum::thread_hdltv_gen() {
    const char* dump_tv = std::getenv("AP_WRITE_TV");
    if (!(dump_tv && string(dump_tv) == "on")) return;

    wait();

    mHdltvinHandle << "[ " << endl;
    mHdltvoutHandle << "[ " << endl;
    int ap_cycleNo = 0;
    while (1) {
        wait();
        const char* mComma = ap_cycleNo == 0 ? " " : ", " ;
        mHdltvinHandle << mComma << "{"  <<  " \"ap_rst\" :  \"" << ap_rst.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"payload_in_data_V\" :  \"" << payload_in_data_V.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"payload_in_valid_V\" :  \"" << payload_in_valid_V.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"payload_in_last_V\" :  \"" << payload_in_last_V.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"payload_length_data_V\" :  \"" << payload_length_data_V.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"payload_length_valid_V\" :  \"" << payload_length_valid_V.read() << "\" ";
        mHdltvoutHandle << mComma << "{"  <<  " \"payload_out_data_V\" :  \"" << payload_out_data_V.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"payload_out_keep_V\" :  \"" << payload_out_keep_V.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"payload_out_valid_V\" :  \"" << payload_out_valid_V.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"payload_out_last_V\" :  \"" << payload_out_last_V.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"checksum_data_V\" :  \"" << checksum_data_V.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"checksum_valid_V\" :  \"" << checksum_valid_V.read() << "\" ";
        mHdltvinHandle << "}" << std::endl;
        mHdltvoutHandle << "}" << std::endl;
        ap_cycleNo++;
    }
}

